//import React from 'react'
import './home.scss'

export default function Home() {
    return (
        <div className="home" id="home">
            <div className="slider">
                <div className="container">
                    <div className="item">
                        <div className="left"></div>
                        <div className="right"></div>
                    </div>
                </div>
            </div>
        </div>
    )
}
